function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length * 7 / 8);
  const view = new Uint8Array(buffer);
  let offset = 0;

  for (const entity of entities) {
    const id = entity.id & 0xF; // 4 bits
    const size = entity.size & 0x7; // 3 bits
    const byte = (id << 3) | size;
    view[offset++] = byte;
    if (offset % 8 === 0) {
      offset = Math.floor(offset / 8);
    }
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new Uint8Array(buffer);
  const entities = [];
  let offset = 0;

  while (offset < view.length) {
    const byte = view[offset++];
    const id = (byte >> 3) & 0xF; // 4 bits
    const size = byte & 0x7; // 3 bits
    entities.push({ id, size });
  }

  return entities;
}
```
