Here is a simple implementation of the `Timeline` class using HTML range input as the slider:
```
class Timeline {
  constructor(parent, timeInSeconds) {
    this.parent = parent;
    this.timeInSeconds = timeInSeconds;
    this.callback = null;

    this.slider = document.createElement('input');
    this.slider.type = 'range';
    this.slider.min = 0;
    this.slider.max = timeInSeconds;
    this.slider.value = 0;
    this.slider.style.width = parent.offsetWidth + 'px';

    parent.appendChild(this.slider);

    this.slider.addEventListener('input', () => {
      if (this.callback) {
        this.callback(this.slider.value);
      }
    });
  }

  setCallback(callback) {
    this.callback = callback;
  }
}
```
